void randombytes(uint8_t *out, size_t outlen) {
  HCRYPTPROV ctx;
  DWORD len;

  if(!CryptAcquireContextA(&ctx, ((void*)0), ((void*)0), 1, 0xF0000000))
    abort();

  while(outlen > 0) {
    len = (outlen > 1048576) ? 1048576 : outlen;
    if(!CryptGenRandom(ctx, len, (BYTE *)out))
      abort();

    out += len;
    outlen -= len;
  }

  if(!CryptReleaseContext(ctx, 0))
    abort();
}
